import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

function Navbar() {
  return (
    <nav>
      <h1 className="text-2xl underline m-2">Brand</h1>
      <ul className="text-2xl m-2">
        <li>Priceing</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </nav>
  );
}

ReactDOM.render(<Navbar />, document.getElementById("root"));

const page = (
  <div>
    <h1>My awsome brand</h1>
    <h2>Reasons i love to code</h2>
    <h3>Fun</h3>
    <h3>Good</h3>
  </div>
);

const nav = document.createElement("nav");
